import React, {Component} from 'react';

class UsersList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedUser: {},
    };
  }

  selectUser(user) {
    this.setState({selectUser: user});
  }

  render() {
    let userElements;
    if (this.props.users.length) {
      userElements = props.users.map((user, idx) => (
        <li key={idx} onClick={() => this.selectUser(user)}>{user.name}</li>
      ));
    } else {
      userElements = 'No Users registered yet.'
    }
    return (
      <div>
        <h1>Registrations</h1>
        <div class="col-split">
          <ul>
            {userElements}
          </ul>
          <div class="user-detail">
            { user }
          </div>
        </div>
      </div>
    );
  }
}

export default UsersList;
